import React from 'react';
export default function Pranayama() {
  return (
    <div className="page">
      <h1>Pranayama</h1>
      <p>Detailed breathing techniques with step-by-step instructions.</p>
      <article>
        <h3>Bhastrika</h3>
        <p>Procedure and effects on the human body (from your teaching materials).</p>
      </article>
    </div>
  );
}
